  "printOn" : 
    "name" : "printOn"
    "qualifiedname" : "dart.json.printOn"
    "comment" : "<p>Serializes <code>object</code> into <code>output</code> stream.</p> <p>Performs the same operations as <code>stringify</code> but outputs the resulting string to an existing <code>StringBuffer</code> instead of creating a new <code>String</code>.</p> <p>If serialization fails by throwing, some data might have been added to <code>output</code>, but it won't contain valid JSON text.</p>"
    "type" : "method"
    "static" : "false"
    "return" : "void"
    "parameters" : 
