        "value" : "null"
  "stringify" : 
    "name" : "stringify"
    "qualifiedname" : "dart.json.stringify"
    "comment" : "<p>Serializes <code>object</code> into a JSON string.</p> <p>Directly serializable values are <code>num</code>, <code>String</code>, <code>bool</code>, and <code>Null</code>, as well as some <code>List</code> and <code>Map</code> values. For <code>List</code>, the elements must all be serializable. For <code>Map</code>, the keys must be <code>String</code> and the values must be serializable.</p> <p>If a value is any other type is attempted serialized, a \"toJson()\" method is invoked on the object and the result, which must be a directly serializable value, is serialized instead of the original value.</p> <p>If the object does not support this method, throws, or returns a value that is not directly serializable, a <code>JsonUnsupportedObjectError</code> exception is thrown. If the call throws (including the case where there is no nullary \"toJson\" method, the error is caught and stored in the <code>JsonUnsupportedObjectError</code>'s <code>:cause:</code> field.</p> <p>If a <code>List</code> or <code>Map</code> contains a reference to itself, directly or through other lists or maps, it cannot be serialized and a <code>JsonCyclicError</code> is thrown.</p> <p>Json Objects should not change during serialization. If an object is serialized more than once, <code>stringify</code> is allowed to cache the JSON text for it. I.e., if an object changes after it is first serialized, the new values may or may not be reflected in the result.</p>"
    "type" : "method"
    "static" : "false"
    "return" : "dart.core.String"
    "parameters" : 
      "object" : 
        "name" : "object"
        "qualifiedname" : "dart.json.stringify#object"
        "optional" : "false"
        "named" : "false"
        "default" : "false"
        "type" : "dart.core.Object"
        "value" : "null"
