  "parse" : 
    "name" : "parse"
    "qualifiedname" : "dart.json.parse"
    "comment" : "<p>Parses <code>json</code> and build the corresponding parsed JSON value.</p> <p>Parsed JSON values are of the types <code>num</code>, <code>String</code>, <code>bool</code>, <code>Null</code>, <code>List</code>s of parsed JSON values or <code>Map</code>s from <code>String</code> to parsed JSON values.</p> <p>The optional <code>revivier</code> function, if provided, is called once for each object or list property parsed. The arguments are the property name (<code>String</code>) or list index (<code>int</code>), and the value is the parsed value. The return value of the revivier will be used as the value of that property instead the parsed value.</p> <p>Throws <code>FormatException</code> if the input is not valid JSON text.</p>"
    "type" : "method"
    "static" : "false"
    "return" : "dynamic"
    "parameters" : 
      "json" : 
        "name" : "json"
        "qualifiedname" : "dart.json.parse#json"
